// motion-impossible-frontend/src/components/Timeline.js
import React from 'react';
import styled from 'styled-components';

// Styled components for styling
const TimelineContainer = styled.div`
  /* Your styling here */
`;

const Playhead = styled.div`
  /* Styling for the playhead */
  background-color: blue;
  height: 100%;
  width: 2px; /* or your preferred width */
  position: absolute;
`;

const Clip = styled.div`
  /* Styling for the clips */
  background-color: lightgray;
  height: 30px;
  width: ${props => props.duration}px; /* dynamic width based on duration */
  position: absolute;
  /* Additional styling properties as needed */
`;

const Timeline = () => {
  return (
    <TimelineContainer>
      <Playhead />
      {/* Render your clips here */}
      <Clip duration={100} style={{ top: '10px', left: '50px' }} />
      {/* Additional clips go here */}
    </TimelineContainer>
  );
};

export default Timeline;
